import React from 'react'
import "./Sidebar.css"

function Sidebar() {
  return (
    <div className='sidebar'>
        <div className='content'>
            <div className='block'>BLOCKS</div>
            <div className='blocks'></div>
        </div>
    </div>
  )
}

export default Sidebar
